import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App flex w-full p-4">
      <header className="App-header w-full h-20 flex justify-between items-center bg-white shadow-lg rounded">
        <div className='Logo-box w-2/12'>
          <img src={logo} alt='Logo' height={60} width={120} className='animate-spin transition-opacity'></img>
        </div>
        <div className='w-10/12 flex justify-end items-center'>
          <ul className='flex px-4'>
            <li className='Nav-item Active'>Home</li>
            <li className='Nav-item'>About Us</li>
            <li className='Nav-item'>Service</li>
            <li className='Nav-item'>Shop</li>
            <li className='Nav-item'>Contact</li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default App;
